import React from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

const Cost = (props) => {
  const test = props.item.map((ite, index) => (
    <li key={index}> {ite.item} </li>
  ));
  return (
    <div>
      <Container
        style={{
          alignitems: "center",
          textAlign: "left",
          fontWeight: "bold",
          color: "black",
        }}
      >
        <Card>
          <Card.Body>
            {" "}
            <ul
              style={{
                alignitems: "center",
                textAlign: "left",
                fontWeight: "bold",
                color: "black",
              }}
            >
              {" "}
              {test}{" "}
            </ul>{" "}
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
  // };
};

export default Cost;
